import './App.css';
import NavbarComp from './components/NavbarComp';
import Home from './pages/Home';



function App() {
  return (
   <Router>
      <NavbarComp/>
      <Switch>
      <Route path='/' exact component={Home}/>

      </Switch>

   </Router>


  );
}

export default App;
